import { useParams, Link } from 'react-router-dom';

export default function EventCreated() {
  const { id } = useParams();
  const link = `${window.location.origin}/event/${id}`;

  return (
    <div className="container">
      <h1>Evento criado com sucesso!</h1>
      <p>Compartilhe este link com seus amigos para que possam votar:</p>
      <input readOnly value={link} onClick={(e) => e.target.select()} style={{ width: '100%', padding: '0.5rem' }} />
      <Link to={`/event/${id}`}>
        <button>Ir para votação</button>
      </Link>
    </div>
  );
}
